import "./App.css";
import Inicio from "./Components/Inicio/Inicio";
import LeftSideBar from "./Components/LeftSideBar/LeftSideBar";
import NavBar from "./Components/NavBar/NavBar";

function App() {
  return (
    <div className="App">
      <NavBar></NavBar>
      <Inicio></Inicio>
      <LeftSideBar></LeftSideBar>
    </div>
  );
}

export default App;
